import React from "react";
import "./navbar.css";

const Navbar = () => {
  return (
    <navbar className="nav">
      <section className="left-nav">
      <p>COCKTAIL</p>
      </section>
      <section className="right-nav">
        <ul>
          <li>Home</li>
          <li>About</li>
        </ul>
      </section>
    </navbar>
  );
};

export default Navbar;
